import React, { useState } from "react";

export default function WorkoutLog() {
  const [log, setLog] = useState([
    {
      day: "Monday",
      muscleGroup: "Chest, Shoulders, Triceps",
      warmups: ["Arm Circles", "Band Pull-Aparts"],
      exercises: [
        { name: "Incline Dumbbell Press", sets: "4", reps: "10", weight: "" },
        { name: "Flat Bench Press", sets: "3", reps: "8", weight: "" },
        { name: "Seated Dumbbell Shoulder Press", sets: "3", reps: "10", weight: "" },
        { name: "Lateral Raises", sets: "3", reps: "15", weight: "" },
        { name: "Tricep Dips", sets: "4", reps: "12", weight: "" }
      ]
    },
    {
      day: "Tuesday",
      muscleGroup: "Legs & Core",
      warmups: ["Bodyweight Squats", "Hip Bridges"],
      exercises: [
        { name: "Barbell Back Squat", sets: "4", reps: "8", weight: "" },
        { name: "Romanian Deadlifts", sets: "3", reps: "10", weight: "" },
        { name: "Walking Lunges", sets: "3", reps: "12", weight: "" },
        { name: "Calf Raises", sets: "3", reps: "15", weight: "" },
        { name: "Plank Hold (Core)", sets: "3", reps: "60s", weight: "" }
      ]
    },
    {
      day: "Wednesday",
      muscleGroup: "HIIT & Core",
      warmups: ["Jumping Jacks", "Dynamic Stretching"],
      exercises: [
        { name: "Rowing Intervals (30s on/30s off)", sets: "6", reps: "30s", weight: "" },
        { name: "Battle Ropes", sets: "4", reps: "20s", weight: "" },
        { name: "Box Jumps", sets: "3", reps: "10", weight: "" },
        { name: "Russian Twists", sets: "3", reps: "20", weight: "" },
        { name: "Hanging Leg Raises", sets: "3", reps: "12", weight: "" }
      ]
    },
    {
      day: "Friday",
      muscleGroup: "Glutes, Hamstrings, Core",
      warmups: ["Glute Bridges", "Leg Swings"],
      exercises: [
        { name: "Hip Thrusts", sets: "4", reps: "10", weight: "" },
        { name: "Bulgarian Split Squats", sets: "3", reps: "10", weight: "" },
        { name: "Hamstring Curls", sets: "3", reps: "12", weight: "" },
        { name: "Glute Kickbacks", sets: "3", reps: "15", weight: "" },
        { name: "Cable Crunches", sets: "3", reps: "15", weight: "" }
      ]
    }
  ]);

  const [completedWarmups, setCompletedWarmups] = useState({});

  const handleChange = (dayIndex, exerciseIndex, field, value) => {
    const updatedLog = [...log];
    updatedLog[dayIndex].exercises[exerciseIndex][field] = value;
    setLog(updatedLog);
  };

  const toggleWarmup = (dayIndex, warmup) => {
    const key = `${dayIndex}-${warmup}`;
    setCompletedWarmups((prev) => ({
      ...prev,
      [key]: !prev[key],
    }));
  };

  return (
    <div className="p-6 space-y-8 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold text-center text-blue-700 mb-4">Workout Tracker</h1>
      {log.map((day, dayIndex) => (
        <div key={day.day} className="bg-white p-4 rounded-xl shadow-md space-y-4">
          <h2 className="text-xl font-semibold border-b pb-2">{day.day} â€“ {day.muscleGroup}</h2>
          <div className="space-y-2">
            <h3 className="text-md font-medium text-gray-700">Warmups</h3>
            {day.warmups.map((warmup, i) => (
              <label key={i} className="flex items-center gap-2 text-sm">
                <input
                  type="checkbox"
                  checked={completedWarmups[`${dayIndex}-${warmup}`] || false}
                  onChange={() => toggleWarmup(dayIndex, warmup)}
                />
                {warmup}
              </label>
            ))}
          </div>
          <div className="space-y-2">
            <h3 className="text-md font-medium text-gray-700 mt-4">Main Exercises</h3>
            {day.exercises.map((exercise, exerciseIndex) => (
              <div
                key={exercise.name}
                className="grid grid-cols-1 sm:grid-cols-4 sm:items-center gap-2"
              >
                <span className="text-sm font-medium">{exercise.name}</span>
                <input
                  className="border rounded p-1 text-sm"
                  placeholder="Sets"
                  value={exercise.sets}
                  onChange={(e) => handleChange(dayIndex, exerciseIndex, "sets", e.target.value)}
                />
                <input
                  className="border rounded p-1 text-sm"
                  placeholder="Reps"
                  value={exercise.reps}
                  onChange={(e) => handleChange(dayIndex, exerciseIndex, "reps", e.target.value)}
                />
                <input
                  className="border rounded p-1 text-sm"
                  placeholder="Weight"
                  value={exercise.weight}
                  onChange={(e) => handleChange(dayIndex, exerciseIndex, "weight", e.target.value)}
                />
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}
